import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f05d3ed8.js";const o={},c=t("<p>《三命通会》卷 九·六辛日庚寅时断</p><p>六辛日生时庚寅，财旺生官遇贵神；金木局中通月气，必为荣贵富豪人。</p><p>辛日庚寅时，贵人财官。</p><p>辛以寅为天乙贵，丙火为官，甲木为财，寅上丙、甲旺，若通金木月气或通运，主富贵显达。</p><p>辛丑日庚寅时，春贵；夏官旺；秋显达；冬吉。</p><p>丑月、南运，风宪或武贵。</p><p>一云发即风疾。</p><p>年月酉、申金，无火气、贫夭。</p><p>辛卯日庚寅时，午未亥子，俱贵。</p><p>寅卯申酉，六、七品贵。</p><p>辛巳日庚寅时，春贵；夏官禄，行西北运，大贵；秋身旺；冬暴狠。</p><p>一云刑后有财。</p><p>辛未日庚寅时，已未丑月，名标金标，妻贤子孝，晚年风疾。</p><p>寅卯午戌，俱吉。</p><p>辛酉日庚寅时，贵。</p><p>春财聚；夏官禄成；秋身旺；亥子丑戌午酉等年月，俱贵。</p><p>辛亥日庚寅时，贵，主有暗疾。</p><p>干透丙，发。</p><p>午酉寅亥年月，南方运，贵。</p><p>六辛之日遇寅时，财旺生官互换推；运拙利名应蹇滞，若行财禄更无虞。</p><p>辛日庚寅时遇，弟兄骨肉生疏。</p><p>双亲祖业靠难成，鸳侣中年违镜。</p><p>亥癸坎壬减福，丙丁巳午驰名。</p><p>春生冬产贵人钦，中末荣华之命。</p>",24),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","253卷 九·六辛日庚寅时断.html.vue"]]);export{f as default};
